import { Provider } from 'react-redux';
import store from './stores/store';
import Basket from './pages/Basket';
// import Slider from './components/Slider';

function App() {
  return (
    <div className="App">
      <BrowserRouter>

<br/>
<br/>
<br/>
<br/>
<Switch>
          <Route exact path="/" component={Product} />
          <Route path="/basket" component={Basket} />
        </Switch>

        <Navbar/>
        <Product/>
      </BrowserRouter>
      {/* <Slider/> */}
    </div>
  );
}

export default App;
